import React, { Component } from 'react'

export default (props) => {
    const person = pprops.ersons.map(
        person => person
    )
    const {name, phoneNumber, email} = person
    return (
        <div>
            <h1>{person.name}</h1>
            <h2>{person.phoneNumber}</h2>
            <h3>{person.email}</h3>
        </div>
    )
}
